import About from "./About"
import Projects from "./Projects"
import Resume from "./Resume"
const pic = require("../images/main_pic(cropped).jpg")

const Content = (props) => {

    return (
        <>
        {
            props.page === "Resume" ? 
                <Resume />
                :
            props.page === "Projects" ?
                <Projects />
                :
                <About pic={props.pic} text={props.page} />
        }
        </>
    )
}

export default Content
